html {
	box-sizing: border-box;
	font-family: sans-serif;
	font-size: 16px;
	background-color: #FFFFFF;
	color: rgb(5, 0, 0);
    height: 100%;
}

*, *::after, *::before { 
	box-sizing: inherit;
	margin: 0; 
	padding: 0;
	font-size: 1rem;
}
body{
    overflow-x: hidden;
    height: 100%;
}
.flexcolumn{
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}
.footerlogo{
    margin-left:auto;
    margin-right: auto;
    width: 20%;
    max-width: 20%;
}
.portada{
    background: url("img/japon2.jpg") no-repeat center;
    height: auto;
    width: 100vw;
    background-size: contain;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}
#japon{
    height: 1.5rem;
}
#horaJapon{
    height: 3rem;
}
a { 
    color: rgb(190,0,41);
    display: block;
    text-decoration: none;
    transition: opacity 1s ease-out, transform 1s ease-out;
}
a:hover {
        opacity: 0.5; 
        transform: scale(0.8);
}
.item a{
    font-size:1.2rem;
    color:rgb(5, 0, 0);
    
}
.item b{font-size: 1.2rem;}
.item a:hover{
    color: #FFF; 
    opacity: 1;
}
footer .item a{
    color: #FFF;
}
footer .item a:hover{
    color:rgb(190,0,41);
}
.opacidad a:hover{
    color:rgb(5, 0, 0);
    opacity: .5;
}

.categorias{
    display: block;
    width: 50%;
}
.image{
    display: block;
    aspect-ratio: 4/3;
    clip-path: circle(45% at 50% 50%);
}
.miLogo{height: 6rem;}
main{max-width: 1200px;}
h1, h2, h3, h4{text-align: center;}

img {
    aspect-ratio: 4/3;/*attr(width) / attr(height);*/
    height: auto;
    width: 100%;
    max-width: 100%;
}

iframe, #video-facade{
    width: 18rem;
    height: 10rem;
    max-width: 100%;
    margin:auto;
    display: block;
}
.imgcategoria {
    display: block;
    margin-left: auto;
    margin-right: auto;
    /*height: 12rem;*/
}
.imgcategoria:hover{
    opacity: 0.5;
    animation: agrandar 1s linear forwards;
}
@keyframes agrandar{
    from {
        transform: scale(1);
    }
    to {
        transform: scale(0.75);
    }
}
figure, picture img{
    width: 75%;
    max-width: 75%;
    margin:auto;
    display: block;
}

figcaption{text-align: center;}
figcaption a{text-align: center;}


h1 { font-size: 2rem; }

h2 { font-size: 1.5rem; }
h3{font-size: 1.2rem;}

li {
	margin-left: 1rem;
	list-style-type: inherit;
	list-style-position: inside;
}

header{
    width: 100%;
    text-align: center;
    background-color: rgb(190,0,41);
    overflow-x: hidden;
}

header figure{
    width: 10%;
    margin:0;
    display: inline-block;
}

nav{
    text-align: center;
    height: auto;
    font-size: 0;
}

p, ul, ol{margin: 1rem 2rem;}
p{
    text-align: left;
}

.navegacionapoyo ul{
    display: inline-block;
    border-bottom: thin solid rgb(5, 0, 0);
    text-align: center;
}
.navegacionapoyo li{
    float: left;
    list-style: none;
    text-align: center;
}
#japon{margin-top: 3.5rem;}
#horaJapon p{
    font-size: 1.5rem;
}
footer {
    background-color: rgb(5, 0, 0);
}
form{
    width: 60%;
    margin:auto;
}
form div{
    margin: 0.5rem 0.5rem;
}
#correo{width: 75%;}
button{
    margin:.25rem .5rem;
    border-radius: 0 .5rem;
    padding: .25rem .5rem;
    background-color: rgb(190,0,41);
    color:#FFF;
}
.no-opacidad{display: initial;}
.no-opacidad:hover{opacity: 1;}
#dango{ width: 2rem;}
#dango:hover{
    animation: rotaDango 1s ease-out infinite;
}
@keyframes rotaDango {
    0%{transform: rotate(0deg);}
    25%{transform: rotate(45deg);}
    50%{transform: rotate(90deg);}
    75%{transform: rotate(45deg);}
    100%{transform: rotate(0deg);}
}
footer p{
    text-align: center;
    color:#FFF;
    font-size: 0.8rem;
}
footer a{
    color:#FFF;
}
footer a:hover{color:rgb(190,0,41);}
footer figure{
    width: 5%;
    max-width: 5%;}

#otrasimagenes{aspect-ratio: 5/3;}
/*  Empiezan las media queries */
@media screen and (min-width: 20em){
    figure{
        width: 70vw;
        max-width: 70vw;
    }
    picture img{max-width: 65%;}
    /*.imgcategoria {height: 14rem;}*/
    footer p{font-size:0.9rem;}
    .item a, .item b{ font-size:1.3rem; }
    #correo{width: 90%;}
    .footerlogo{
        width: 15%;
        max-width: 15%;
    }
}

@media screen and (min-width: 30em){
    /*.imgcategoria {height: 18rem;}*/
    .item a, .item b{ font-size:1.4rem; }
    #correo{width: 85%;}
    #otrasfigures{
        margin:auto;
        width: 360px;
        max-width: 360px;
        height: auto;
    }
    #otrasimagenes{height: 190px;}
}

@media screen and (min-width: 37.5em){
    /*.imgcategoria {height: 13rem;}*/
    header figure{width: 8%;}
    .item a, .item b{ font-size:1.5rem; }
    .portada{
        height: auto;
        background: url("img/japon.png") no-repeat center;
        background-size: cover;
    }
    .cortar{
        clip-path: polygon(0% 0%, 100% 0, 100% 15%, 0% 15%);
        text-align: center;
        transition: clip-path 2s ease-out;
        margin-top: 1.5rem;
    }
    .cortar:hover{
        clip-path: polygon(0 0, 100% 0%, 100% 100%, 0 100%);
    }
    
    .categorias{
        width: 30%;
        padding:2rem;
    }
    main{
        width: 90vw;
        margin:auto;
    }

    .containerflex{
        display:flex;
        flex-wrap: wrap;
        justify-content: center;
        margin:1rem 0;
        align-items: center;
    }
    .paraheader{
        margin:0;
        justify-content: flex-start;
    }
    .itemflex{flex-shrink: 0;}
    .itemflexheader{margin-right: auto;}
    figure{
        width: 40vw;
        max-width: 40vw;
        margin: 1rem 1rem;
    }
    footer figure{max-width: 5%;}

    .item{
        display: inline-block;
        padding: 0 0.5rem;
    }
    
    iframe, #video-facade{
        width: 22rem;
        height: 12rem;
    }
    .footerlogo{
        width: 13%;
        max-width: 13%;
    }
}

@media screen and (min-width: 48em){
    figure{
        width: 30vw;
        max-width: 30vw;
    }
    picture img{max-width: 60%;}
    .categorias{
        width: 20%;
        margin:0;
    }

    .containergrid{
        display:grid;
        grid-template-columns: 1fr 4fr;
        grid-template-areas: "navegacio contenido";
    }
    .itemgrid1{
        grid-area: navegacio;
    }
    .itemgrid2{grid-area: contenido;}
    header figure{width: 6%;}

    .portada figure{max-width: 35%;}

    /*.imgcategoria {height: 13rem;}*/
    .navegacionapoyo{margin-top: 1.3rem;}

    .navegacionapoyo ul{
        display: inline-block;
        border:0;
    }
    .navegacionapoyo li{
        float: initial;
        list-style: none;
        text-align: left;
    }
    
    iframe, #video-facade{
        width: 25rem;
        height: 14rem;
    }
    form{width: 50%;}
    #correo{width: 85%;}
    .footerlogo{
        width: 10%;
        max-width: 10%;
    }
}

@media screen and (min-width: 64em){
    figure{
        width: 20vw;
        max-width: 20vw;
    }
    picture img{max-width: 40%;}
    header figure{width: 5%;}
    .categorias{
        width: 20%;
    }
    footer p{font-size: 1rem;}
    footer figure{max-width: 4%;}
    .portada figure{max-width: 25%;}
    iframe, #video-facade{
        width: 30rem;
        height: 17rem;
    }
    form{width: 40%;}
    .especial{
        width: 80vw;
        margin:auto;
    }
    .footerlogo{
        width: 6%;
        max-width: 6%;
    }
}

@media screen and (min-width: 75em){
    header{
        height: 4.5rem;
    }
    .item a, .item b{ font-size:1.6rem; }
    footer figure{ max-width: 5%;
    }
    header figure{width: 5%;}
    footer figure{max-width: 3%;}
    .portada figure{max-width: 25%;}
    iframe, #video-facade{
        width: 35rem;
        height: 20rem;
    }
    .containergrid{
        grid-template-columns: 1fr 5fr;
    }
    form{width: 35%;}
}
